        }
        this._user = {
            id: 1, email: 'fil@mail.ru', nikname: 'User', serverId: 3
        }
        makeAutoObservable(this)
    }

    setMainers(mainers){
        this._mainers = mainers
    }

    setUslov(uslov){
        this._uslov = uslov
    }

    setServer(server){
        this._server = server
    }

    setUser(user){
        this._user = user
    }

    get mainers(){
        return this._mainers
    }

    get uslov(){
        return this._uslov
    }

    get server(){
        return this._server
    }

    get user(){
        return this._user
    }
    
}
